dnf(1212,axiom,[-documentation('TimePoint','EnglishLanguage','An extensionless point on the universal timeline. The &%TimePoints at which &%Processes occur can be known with various degrees of precision and approximation, but conceptually &%TimePoints are point-like and not interval-like. That is, it doesnt make sense to talk about how long a &%TimePoint lasts.')],g,_).
dnf(1213,axiom,[-subclass('FunctionQuantity','PhysicalQuantity')],g,_).
dnf(1214,axiom,[-documentation('FunctionQuantity','EnglishLanguage','A &%FunctionQuantity is a &%PhysicalQuantity that is returned by a &%Function that maps from one or more instances of &%ConstantQuantity to another instance of &%ConstantQuantity. For example, the velocity of a particle would be represented by a &%FunctionQuantity relating values of time (which are instances of &%ConstantQuantity) to values of distance (also instances of &%ConstantQuantity). Note that all elements of the range of the &%Function corresponding to a &%FunctionQuantity have the same physical dimension as the &%FunctionQuantity itself.')],g,_).
