dnf(1216,axiom,[-documentation('UnaryConstantFunctionQuantity','EnglishLanguage','A &%subclass of &%FunctionQuantity, instances of which are returned by &%UnaryFunctions that map from one instance of the &%Class &%ConstantQuantity to another instance of the &%Class &%ConstantQuantity.')],g,_).
