dnf(1220,axiom,[-documentation('TimeDependentQuantity','EnglishLanguage','A &%UnaryConstantFunctionQuantity of continuous time. All instances of this &%Class are returned by &%Functions that map a time quantity into another &%ConstantQuantity such as temperature. For example, the temperature at the top of the Empire State Building is a &%TimeDependentQuantity, since its value depends on the time.')],g,_).
