dnf(5724,axiom,[-range('SpeedFn','FunctionQuantity')],g,_).
dnf(5725,axiom,[-documentation('SpeedFn','EnglishLanguage','Maps an instance of &%LengthMeasure and an instance of &%TimeDuration to the speed represented by this proportion of distance and time. For example, (&%SpeedFn (&%MeasureFn 55 &%Mile)(&%MeasureFn 1 &%HourDuration)) represents the velocity of 55 miles per hour.')],g,_).
