dnf(5736,axiom,[-instance('Meter','UnitOfLength')],g,_).
dnf(5737,axiom,[-instance('Meter','SystemeInternationalUnit')],g,_).
dnf(5738,axiom,[-documentation('Meter','EnglishLanguage','SI &%UnitOfLength. Symbol: m. It is one of the base units in SI, and it is currently defined as follows: the &%Meter is the length of the path traveled by light in a vacuum during a time interval of 1/299792458 of a &%SecondDuration.')],g,_).
dnf(5739,axiom,[-instance('Gram','UnitOfMass')],g,_).
dnf(5740,axiom,[-instance('Gram','SystemeInternationalUnit')],g,_).
dnf(5741,axiom,[-documentation('Gram','EnglishLanguage','Submultiple of kilogram. Symbol: g. 1 kilogram = 1000 &%Grams.')],g,_).
dnf(5742,axiom,[-instance('SecondDuration','UnitOfDuration')],g,_).
dnf(5743,axiom,[-instance('SecondDuration','SystemeInternationalUnit')],g,_).
dnf(5744,axiom,[-documentation('SecondDuration','EnglishLanguage','SI &%UnitOfDuration. Symbol: s. It is one of the base units in SI, and it is currently defined as follows: the &%SecondDuration is the duration of 9192631770 periods of the radiation corresponding to the transition between the two hyperfine levels of the ground state of the cesium 133 atom.')],g,_).
dnf(5745,axiom,[-instance('Ampere','CompositeUnitOfMeasure')],g,_).
dnf(5746,axiom,[-instance('Ampere','SystemeInternationalUnit')],g,_).
dnf(5747,axiom,[-documentation('Ampere','EnglishLanguage','SI electric current measure. Symbol: A. It is one of the base units in SI. It is defined as follows: the &%Ampere is that constant current which, if maintained in two straight parallel conductors of infinite length, of negligible circular cross-section, and placed 1 &%Meter apart in a vacuum, would produce between these conductors a force equal to 2*10^(-7) &%Newton per &%Meter of length.')],g,_).
dnf(5748,axiom,[-instance('KelvinDegree','UnitOfTemperature')],g,_).
dnf(5749,axiom,[-instance('KelvinDegree','SystemeInternationalUnit')],g,_).
dnf(5750,axiom,[-instance('SystemeInternationalUnit','SetOrClass')],g,_).
dnf(5751,axiom,[-documentation('KelvinDegree','EnglishLanguage','SI &%UnitOfMeasure used with &%MeasureFn to produce terms denoting instances of &%TemperatureMeasure. Symbol: K. It is one of the base units in SI (it is also a unit in the ITS system). Kelvin differs from the Celsius scale in that the triple point of water is defined to be 273.16 &%KelvinDegrees while it is 0 &%CelsiusDegrees. The magnitudes of intervals in the two scales are the same. By definition the conversion constant is 273.15.')],g,_).
dnf(5752,axiom,[-instance('Mole','UnitOfMass')],g,_).
dnf(5753,axiom,[-instance('Mole','SystemeInternationalUnit')],g,_).
dnf(5754,axiom,[-documentation('Mole','EnglishLanguage','SI amount of substance unit. symbol: mol. It is one of the base units in SI. It is defined as follows: the &%Mole is the amount of substance of a system which contains as many elementary entities as there are atoms in 0.012 &%Kilograms of carbon 12. Note that, when this &%UnitOfMeasure is used, the elementary entities must be specified - they may be atoms, molecules, ions, electrons, etc. or groups of such particles.')],g,_).
dnf(5755,axiom,[-instance('Candela','CompositeUnitOfMeasure')],g,_).
dnf(5756,axiom,[-instance('Candela','SystemeInternationalUnit')],g,_).
dnf(5757,axiom,[-documentation('Candela','EnglishLanguage','SI luminosity intensity measure. Symbol: cd. It is one of the base units in SI, and it is currently defined as follows: the &%Candela is the luminous intensity, in a given direction, of a source that emits monochromatic radiation of frequency 540*10^12 &%Hertz and that has a radiant intensity in that direction of 1/683 &%Watt per &%Steradian.')],g,_).
dnf(5758,axiom,[-instance('Liter','UnitOfVolume')],g,_).
dnf(5759,axiom,[-documentation('Liter','EnglishLanguage','Unit of volume in the metric system. It is currently defined to be equal to one cubic decimeter (0.001 cubic meter). Symbol: l.')],g,_).
dnf(5760,axiom,[-instance('Centimeter','UnitOfLength')],g,_).
dnf(5761,axiom,[-documentation('Centimeter','EnglishLanguage','Submultiple of &%Meter. Symbol: cm. It is the 100th part of a &%Meter')],g,_).
dnf(5762,axiom,[instance(A,'RealNumber'),A=times(1,A),- ('MeasureFn'(A,'Centimeter')='MeasureFn'(times(A,0.01),'Meter'))],n,_).
dnf(5763,axiom,[-documentation('Millimeter','EnglishLanguage','Submultiple of Meter. Symbol: mm. A millimeter is the 1000th part of a meter')],g,_).
dnf(5764,axiom,[-instance('Millimeter','UnitOfLength')],g,_).
dnf(5765,axiom,[instance(A,'RealNumber'),A=times(1,A),- ('MeasureFn'(A,'Millimeter')='MeasureFn'(times(A,0.001),'Meter'))],n,_).
dnf(5766,axiom,[-instance('Kilometer','UnitOfLength')],g,_).
dnf(5767,axiom,[-documentation('Kilometer','EnglishLanguage','Supermultiple of &%Meter. Symbol: km. A &%Meter is the 1000th part of a &%Kilometer')],g,_).
dnf(5768,axiom,[instance(A,'RealNumber'),A=times(1,A),- ('MeasureFn'(A,'Kilometer')='MeasureFn'(times(A,1000),'Meter'))],n,_).
dnf(5769,axiom,[-instance('Radian','UnitOfAngularMeasure')],g,_).
dnf(5770,axiom,[-instance('Radian','SystemeInternationalUnit')],g,_).
dnf(5771,axiom,[-documentation('Radian','EnglishLanguage','SI plane angle measure. Symbol: rad. It is the angle of a circle subtended by an arc equal in length to the circles radius. Another definition is: the plane angle between two radii of a circle which cut off on the circumference an arc equal in length to the radius. &%Radian = m/m = 1.')],g,_).
dnf(5772,axiom,[-instance('Steradian','UnitOfAngularMeasure')],g,_).
dnf(5773,axiom,[-instance('Steradian','SystemeInternationalUnit')],g,_).
dnf(5774,axiom,[-documentation('Steradian','EnglishLanguage','SI solid angle measure. Symbol: sr. It is the solid angle of a sphere subtended by a portion of the surface whose area is equal to the square of the spheres radius. Another definition is: the solid angle which, having its vertex in the center of the sphere, cuts off an area of the surface of the sphere equal to that of a square with sides of length equal to the radius of the sphere. &%Steradian = m^2/m^2 = 1.')],g,_).
dnf(5775,axiom,[-subclass('FrequencyMeasure','TimeDependentQuantity')],g,_).
dnf(5776,axiom,[-instance('FrequencyMeasure','SetOrClass')],g,_).
dnf(5777,axiom,[-documentation('FrequencyMeasure','EnglishLanguage','A &%subclass of &%TimeDependentQuantity, instances of which are measures of the frequency with which some &%Process occurs.')],g,_).
dnf(5778,axiom,[-subclass('UnitOfFrequency','CompositeUnitOfMeasure')],g,_).
dnf(5779,axiom,[-instance('UnitOfFrequency','SetOrClass')],g,_).
dnf(5780,axiom,[-documentation('UnitOfFrequency','EnglishLanguage','Every instance of this &%Class is a &%UnitOfMeasure that can be used with &%MeasureFn to form instances of &%FrequencyMeasure.')],g,_).
dnf(5781,axiom,[instance(A,'RealNumber'),instance(B,'UnitOfMeasure'),-instance(C,'FrequencyMeasure'),'MeasureFn'(A,B)=C,instance(B,'UnitOfFrequency')],n,_).
dnf(5782,axiom,[-instance('Hertz','UnitOfFrequency')],g,_).
dnf(5783,axiom,[-instance('Hertz','SystemeInternationalUnit')],g,_).
dnf(5784,axiom,[-documentation('Hertz','EnglishLanguage','SI frequency measure. Symbol: Hz. It is the number of cycles per second. &%Hertz = s^(-1). Note that &%Hertz does not have a conversion function.')],g,_).
dnf(5785,axiom,[-instance('Newton','CompositeUnitOfMeasure')],g,_).
dnf(5786,axiom,[-instance('Newton','SystemeInternationalUnit')],g,_).
dnf(5787,axiom,[-documentation('Newton','EnglishLanguage','SI force measure. Symbol: N. It is that force which gives to a mass of 1 kilogram an acceleration of 1 &%Meter per &%SecondDuration. &%Newton = m*kg*s^(-2).')],g,_).
dnf(5788,axiom,[-instance('Pascal','CompositeUnitOfMeasure')],g,_).
dnf(5789,axiom,[-instance('Pascal','SystemeInternationalUnit')],g,_).
dnf(5790,axiom,[-documentation('Pascal','EnglishLanguage','SI pressure measure. Symbol:Pa. It is the pressure of one &%Newton per square &%Meter. &%Pascal = N/m^2 = m^(-1)*kg*s^(-2).')],g,_).
dnf(5791,axiom,[-instance('Joule','CompositeUnitOfMeasure')],g,_).
dnf(5792,axiom,[-instance('Joule','SystemeInternationalUnit')],g,_).
dnf(5793,axiom,[-documentation('Joule','EnglishLanguage','SI energy measure. Symbol: J. It is the work done when the point of application of 1 &%Newton is displaced a distance of 1 &%Meter in the direction of the force. &%Joule = N*m = m^2*kg*s^(-2).')],g,_).
dnf(5794,axiom,[-instance('Watt','CompositeUnitOfMeasure')],g,_).
dnf(5795,axiom,[-instance('Watt','SystemeInternationalUnit')],g,_).
dnf(5796,axiom,[-documentation('Watt','EnglishLanguage','SI power measure. Symbol: W. A &%UnitOfMeasure that measures power, i.e. energy produced or expended divided by &%TimeDuration. It is the power which gives rise to the production of energy (or work) at the rate of one &%Joule per &%SecondDuration. &%Watt = J/s = m^2*kg*s^(-3).')],g,_).
dnf(5797,axiom,[-instance('Horsepower','CompositeUnitOfMeasure')],g,_).
dnf(5798,axiom,[-documentation('Horsepower','EnglishLanguage','A power measure that is equal to 746 &%Watts.')],g,_).
dnf(5799,axiom,[instance(A,'RealNumber'),- ('MeasureFn'(A,'Horsepower')='MeasureFn'(times(A,746),'Watt'))],n,_).
dnf(5800,axiom,[-instance('Coulomb','CompositeUnitOfMeasure')],g,_).
dnf(5801,axiom,[-instance('Coulomb','SystemeInternationalUnit')],g,_).
dnf(5802,axiom,[-documentation('Coulomb','EnglishLanguage','SI electric charge measure. Symbol: C. It is the quantity of electric charge transported through a cross section of a conductor in an electric circuit during each &%SecondDuration by a current of 1 &%Ampere. Coulomb = s*A.')],g,_).
dnf(5803,axiom,[instance(A,'RealNumber'),B='MeasureFn'(A,'Coulomb'),-instance(B,'TimeDependentQuantity')],n,_).
dnf(5804,axiom,[-instance('Volt','CompositeUnitOfMeasure')],g,_).
dnf(5805,axiom,[-instance('Volt','SystemeInternationalUnit')],g,_).
dnf(5806,axiom,[-documentation('Volt','EnglishLanguage','SI electric potential measure. Symbol: V. It is the difference of electric potential between two points of a conducting wire carrying a constant current of 1 &%Ampere, when the power dissipated between these points is equal to 1 &%Watt. &%Volt = W/A = m^2*kg*s^(-3)*A^(-1).')],g,_).
dnf(5807,axiom,[-instance('Farad','CompositeUnitOfMeasure')],g,_).
dnf(5808,axiom,[-instance('Farad','SystemeInternationalUnit')],g,_).
dnf(5809,axiom,[-documentation('Farad','EnglishLanguage','SI capacitance measure. Symbol: F. It is the capacitance of a capacitator between the plates of which there appears a difference of potential of 1 &%Volt when it is charged by a quantity of electricity equal to 1 Coulomb. &%Farad = C/V = m^(-2)*kg(-1)*s^4*A^2.')],g,_).
dnf(5810,axiom,[-instance('Ohm','CompositeUnitOfMeasure')],g,_).
dnf(5811,axiom,[-instance('Ohm','SystemeInternationalUnit')],g,_).
dnf(5812,axiom,[-documentation('Ohm','EnglishLanguage','SI electric resistance measure. It is the electric resistance between two points of a conductor when a constant difference of potential of 1 &%Volt, applied between these two points, produces in this conductor a current of 1 &%Ampere, this conductor not being the force of any electromotive force. &%Ohm = V/A = m^2*kg*s^(-3)*A^(-2).')],g,_).
dnf(5813,axiom,[-instance('Siemens','CompositeUnitOfMeasure')],g,_).
dnf(5814,axiom,[-instance('Siemens','SystemeInternationalUnit')],g,_).
dnf(5815,axiom,[-documentation('Siemens','EnglishLanguage','SI electric conductance measure. Symbol: S. In the case of direct current, the conductance in &%Siemens is the reciprocal of the resistance in &%Ohms, in the case of alternating current, it is the reciprocal of the impedance in ohms. siemens = A/V = m^(-2)*kg(-1)*s^(3)*A^2.')],g,_).
dnf(5816,axiom,[-instance('Weber','CompositeUnitOfMeasure')],g,_).
dnf(5817,axiom,[-instance('Weber','SystemeInternationalUnit')],g,_).
dnf(5818,axiom,[-documentation('Weber','EnglishLanguage','SI magnetic flux measure. Symbol: Wb. It is the magnetic flux which, linking a circuit of one turn, produces in it an electromotive force of 1 &%Volt as it is reduced to zero at a uniform rate in 1 &%SecondDuration. &%Weber = V*s = m^2*kg*s^(-2)*A^(-1).')],g,_).
dnf(5819,axiom,[-instance('Tesla','CompositeUnitOfMeasure')],g,_).
dnf(5820,axiom,[-instance('Tesla','SystemeInternationalUnit')],g,_).
dnf(5821,axiom,[-documentation('Tesla','EnglishLanguage','SI magnetic flux density measure. Symbol: T. One &%Tesla equals one &%Weber per square &%Meter. &%Tesla = Wb/m^2 = kg*s^(-2)*A^(-1).')],g,_).
dnf(5822,axiom,[-instance('Henry','CompositeUnitOfMeasure')],g,_).
dnf(5823,axiom,[-instance('Henry','SystemeInternationalUnit')],g,_).
dnf(5824,axiom,[-documentation('Henry','EnglishLanguage','SI inductance measure. Symbol: H. One &%Henry is equivalent to one &%Volt divided by one &%Ampere per &%SecondDuration. If a current changing at the rate of one &%Ampere per &%SecondDuration induces an electromotive force of one &%Volt, the circuit has an inductance of one &%Henry. &%Henry = Wb/A = m^2*kg*s^(-2)*A^(-2).')],g,_).
