dnf(5827,axiom,[-instance('UnitOfTemperature','SetOrClass')],g,_).
dnf(5828,axiom,[-instance('CelsiusDegree','SystemeInternationalUnit')],g,_).
dnf(5829,axiom,[-documentation('CelsiusDegree','EnglishLanguage','A &%TemperatureMeasure. The freezing point and the boiling point of water are, respectively, 0 &%CelsiusDegrees and 100 &%CelsiusDegrees.')],g,_).
