dnf(5832,axiom,[-instance('Lumen','CompositeUnitOfMeasure')],g,_).
dnf(5833,axiom,[-instance('Lumen','SystemeInternationalUnit')],g,_).
dnf(5834,axiom,[-documentation('Lumen','EnglishLanguage','SI luminous flux measure. Symbol: lm. It is the amount streaming outward through one solid angle of 1 &%Steradian from a uniform point source having an intensity of one &%Candela. &%Lumen = cd*sr = cd * 1.')],g,_).
dnf(5835,axiom,[-instance('Lux','CompositeUnitOfMeasure')],g,_).
dnf(5836,axiom,[-instance('Lux','SystemeInternationalUnit')],g,_).
dnf(5837,axiom,[-documentation('Lux','EnglishLanguage','SI illuminance measure. Symbol: lx. It is the amount of illumination provided when one &%Lumen is evenly distributed over an area of 1 square &%Meter. This is also equivalent to the illumination that would exist on a surface all points of which are one &%Meter from a point source of one &%Candela. &%Lux = lm/m^2 = m^(-2)*cd.')],g,_).
dnf(5838,axiom,[-instance('Becquerel','CompositeUnitOfMeasure')],g,_).
dnf(5839,axiom,[-instance('Becquerel','SystemeInternationalUnit')],g,_).
dnf(5840,axiom,[-documentation('Becquerel','EnglishLanguage','SI activity measure. Symbol: Bq. It measures the amount of radioactivity contained in a given sample of matter. It is that quantity of a radioactive element in which there is one atomic disintegration per &%SecondDuration. &%Becquerel = s^(-1).')],g,_).
dnf(5841,axiom,[instance(A,'RealNumber'),B='MeasureFn'(A,'Becquerel'),-instance(B,'TimeDependentQuantity')],n,_).
dnf(5842,axiom,[-instance('Gray','CompositeUnitOfMeasure')],g,_).
dnf(5843,axiom,[-instance('Gray','SystemeInternationalUnit')],g,_).
dnf(5844,axiom,[-documentation('Gray','EnglishLanguage','SI absorbed dose measure. Symbol: Gy. It measures the dose of radiation absorbed in living tissue. It is equal approximately to the absorbed dose delivered when the energy per unit mass imparted to matter by ionizing radiation is 1 &%Joule per kilogram. &%Gray = J/kg = m^2*s^(-2).')],g,_).
dnf(5845,axiom,[-instance('Sievert','CompositeUnitOfMeasure')],g,_).
dnf(5846,axiom,[-instance('Sievert','SystemeInternationalUnit')],g,_).
dnf(5847,axiom,[-documentation('Sievert','EnglishLanguage','SI dose equivalent measure. Symbol: Sv. It is a unit of biologic dose of ionizing radiation. The &%Sievert makes it possible to normalize doses of different types of radiation. It takes into account the relative biologic effectiveness of ionizing radiation, since each form of such radiation--e.g., X rays, gamma rays, neutrons-- has a slightly different effect on living tissue for a given absorbed dose. The dose equivalent of a given type of radiation (in &%Sievert) is the dose of the radiation in &%Gray multiplied by a quality factor that is based on the relative biologic effectiveness of the radiation. Accordingly, one &%Sievert is generally defined as the amount of radiation roughly equivalent in biologic effectiveness to one &%Gray of gamma radiation. &%Sievert = J/kg = m^2*s^(-2)')],g,_).
