dnf(5860,axiom,[-instance('MonthDuration','UnitOfDuration')],g,_).
dnf(5861,axiom,[-documentation('MonthDuration','EnglishLanguage','Time unit. A months duration is at least 28 days, and no more than 31 days. Note that this unit is a range, rather than an exact amount, unlike most other units.')],g,_).
