dnf(20772,axiom,[-documentation('Iridium','EnglishLanguage','Very hard and brittle, silvery metallic transition element. It has a yellowish cast to it. Salts of iridium are highly colored. It is the most corrosion resistant metal known, not attacked by any acid, but is attacked by molten salts. There are two natural isotopes of iridium, and 4 radioisotopes, the most stable being Ir-192 with a half-life of 73.83 days. Ir-192 decays into {platinum}, while the other radioisotopes decay into {osmium}. Iridium is used in high temperature apparatus, electrical contacts, and as a hardening agent for platinum. Discovered in 1803 by Smithson Tennant in England. The name comes from the Greek word iris, which means rainbow. Iridium metal is generally non-toxic due to its relative unreactivity, but iridium compounds should be considered highly toxic.')],g,_).
